// Define our encounter query:
//
// Find all encounters for a given client (DEMO)

val encounterSourceQuery = """
{  
  "query": {
    "constant_score": {
      "filter": {
        "bool": {
          "must": [
            {"term":{"client_code" : "DEMO" }},
            {"has_parent" : {
                "parent_type": "person",
                "query": {
                  "bool": {
                    "must": [
                      { "range": {"last_name": {"gte":"A","lte":"B"}}}
                    ]
                  }
                }
              }
            }
          ]
        }
      }
    }
  }
}
"""

// limit the fields that are included
val encounterSourceQueryOptions = Map(
  "es.read.field.include" -> "recordId,parent,admit_date,service_category,facility.code"
)

