sqlQuery: String =
"
select cur.encounterId,
case when prv.personid is null then 99 else datediff(cur.admitDate,prv.admitDate)/365.25 end as yearsBetweenNotSC -- ,
-- row_number() over (partition by cur.personId,cur.serviceCategory,cur.enc_seq order by prv.enc_seq desc) as not_sc_seq
from encounter cur
left join encounter prv on cur.personId = prv.personId
and cur.enc_seq > prv.enc_seq
and cur.serviceCategory <> prv.serviceCategory
"







sqlQuery2: String =
"
select cur.encounterId
from encounterWithY cur
left join encounterWithY prv on cur.personId = prv.personId
and cur.enc_seq = prv.enc_seq_prev
"













































